import React from "react";
// import profileImage from "../assets/images/profile_image.png";

export default function LandingPage() {
  return (
    <>
      <div className="flex items-center h-screen">
        <div className="text-white p-4 pl-20 flex flex-col items-center">
          {/* Header */}
          <p className="text-4xl font-bold">Hi!</p>
          <p className="text-8xl font-bold">I'm Emmanuel Kasuti</p>
          <p>I'm a Software Developer, Front-end Web, and Mobile Designer.</p>
        </div>
      </div>
    </>
  );
}
